    "a-narrative-report-mingo-national-wildlife-refuge-september-through-december-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1963. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development section discusses physical developments,
    plantings, and wildfires. A progress report on field investigations and applied
    research is included. Resource management is outlined; topics include fur harvesting
    and timber removal. The public relations section discusses recreational uses, Refuge
    visitors, Refuge visitors, Refuge participation, hunting, and safety. N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
